    setListTitle('Sorted in Ascending Order');
  })

  return (
    <div className="app">
      <h1>Hi there!</h1>
      <DemoList title = {listTitle} items={[6,2,7,5,1]}></DemoList>
      <Button onClick={setParaHandler}>Toggle Paragraph</Button>
    </div>
  );
}

